import { FastField } from "formik";
import React, { useEffect } from "react";

export const TypesOfAtt = ({ name, typeAtt, rowData }) => {
  console.log("typeOfAtt");
  useEffect(() => {
    console.log(rowData.categories.map((item)=>item.tityle));
  }, [typeAtt]);
  return (
    <div className="bg-info">
      {rowData.categories.map((item) => {
        <div className="container">
          <div className="text-center fs-5 m-3">
            <span>گروه :{item.title}</span>
          </div>
          <div className="input-group">
            <span
              className="input-group-text w-25 d-flex justify-content-center"
              htmlFor=""
            >
              typeOfAtt
            </span>
            <FastField name={name} type="input" className="form-control" />
            <span
              className="input-group-text w-25 d-flex justify-content-center"
              htmlFor=""
            >
              typeOfAtt
            </span>
          </div>
        </div>;
      })}
    </div>
  );
};
